import './styles/App.css';
import {Routes, Route} from 'react-router-dom'
import Header from './components/Header'

import Landing from './pages/Landing';

function App() {
  return (
    <div className="App">
      <Header />

      <Routes>
        <Route path='/' element={<Landing />} />
      </Routes>
    </div>
  );
}

export default App;
